bioghist.p:
Door middel van een aantal organisatiewijzigingen werd het crisisapparaat gecentraliseerd. Verscheidene crisisorganisaties werden samengevoegd en het aantal regeringscommissarissen werd teruggebracht tot 5. 

Zie afbeeldingen bij de inleiding. 
					)

De regeringscommissaris voor de uitvoering van de Tarwewet 1931, dr. ir. S.L. Louwes, werd op 25 april 1934 benoemd tot regeringscommissaris voor de steunverlening aan de varkenshouderij, de granen, de peulvruchten en de fabrieksaardappelen. Met ingang van 21 december 1934 werd zijn functiebenaming gewijzigd in regeringscommissaris voor de akkerbouw en veehouderij. Het Bureau van de Regeringscommissaris van de Melkveehouderij werd in 1937 aan zijn Bureau toegevoegd.

Min. besch. 24-02-1937, no. 4408, afd. L.C.A. 
					)

Eind 1936 was dr. ir. S.L. Louwes nauw betrokken bij de organisatie van de economische verdedegingsvoorbereiding. Het op 1 april 1937 ingestelde Rijksbureau voor de Voorbereiding van de Voedselvoorziening in Oorlogstijd kwam onder zijn leiding te staan. Na een aantal reorganisaties verschoof zijn taak van de uitvoering van de landbouwcrisismaatregelen naar de zorg voor de voedselvoorziening. De Stichting Regeringsbureau voor de Uitvoering van de Landbouwcrisiswet 1933 werd op 1 oktober 1939, tesamen met het Rijksbureau voor de Voorbereiding van de Voedselvoorziening in Oorlogstijd, samengevoegd tot de Stichting Rijksbureau voor de Voedselvoorziening in Oorlogstijd en de Uitvoering van de Landbouwcrisiswet 1933.

Min. besch. 30-09-1939, no. 20342, afd. L.C.A./V.V.O. 
					) Deze Stichting werd op 26 mei 1940 samengevoegd met de afdeling Landbouwcrisisaangelegenheden en Voedselvoorziening in Oorlogstijd tot het Rijksbureau voor de Voedselvoorziening in Oorlogstijd.

Na de oorlog werd dit Rijksbureau opgeheven en vervangen door de Directie van de Voedselvoorziening.

Min. besch. 11-10-1945, no. K 665, afd. Kabinet. 
					)

